import React, { Component } from 'react';
import '../index.css';
import Navigation from './navbar';

class Tutorial extends Component {
    render() {
        return (
            <main>
                <div>
                    <Navigation />
                </div>
                <div>
                    <p>Tutorials Component!</p>
                </div>
            </main>
        )
    }
}

export default Tutorial;
